<div ng-app="getjvCertificates">

	<div style="margin-right: 20px" class="welcome-panel" ng-controller="certCtrl as cert">
	<div class=" well well-sm">
		<h1>Gerador de Certificados </h1>
		<small>
			<p>Preencha todos os campos para então gerar o certificado.</p>
			<p>Caso tenha dúvidas sobre como funciona utilize as opções "Visualizar", "Carregar exemplo" e "Ver PDF"</p>
		</small>
	</div>
		
		
		
		
	
		<form style="padding:10px" name="certForm" ng-submit="certForm.$valid && cert.submit()" novalidate>

			<div class="form-group col-sm-6 control-label">
				<label for="" >Nome do Evento</label>
				<textarea required ng-model="cert.form.nomeEvento" class="form-control" rows="3" placeholder="Nome do evento principal. Ex: tradução dos vídeos da série Joy of Code">{{cert.form.nomeEvento}}</textarea>
			</div>
			
			<div class="form-group col-sm-6 control-label">
				<label for="">Descrição do Evento</label>
				<textarea  required ng-model="cert.form.descricaoEvento" class="form-control" rows="3" placeholder="Ex: Joy of Code, É uma série de vídeos direcionada ... ">{{cert.form.descricaoEvento}}</textarea>
			</div>
			
			<div class="form-group col-sm-3 control-label">
				<label for="">Quantidade de horas</label>
				<input required ng-model="cert.form.quantidadeHoras" value={{cert.form.quantidadeHoras}} type="number" min="1" max="999" class="form-control" id="exampleInputEmail1" placeholder="Quantidade de trabalho do voluntário em horas">
			</div>
			
			<div class="form-group col-sm-3 control-label">
				<label for="">Quantidade de meses</label>
				<input required ng-model="cert.form.quantidadeMeses" value={{cert.form.quantidadeMeses}} type="number" min="1" max="999" class="form-control" id="exampleInputEmail1" placeholder="Quantidade de trabalho do voluntário em meses">
			</div>
						
			<div class="form-group col-sm-6 control-label">
				<label for="">Descrição das atividades</label>
				<textarea required ng-model="cert.form.descricaoAtividades" class="form-control" rows="3" placeholder="Separe cada atividade por ponto-e-virgula">{{cert.form.descricaoAtividades}}</textarea>
			</div>
			
			<div  class="clearfix"></div>
			
			<div class="form-group col-sm-6 control-label">
				<label for="">Nome do Assinante</label>
				<input required ng-model="cert.form.nomeAssinante" value={{cert.form.nomeAssinante}} type="text" class="form-control" id="" placeholder="Nome do membro DFJUG que vai assinar o certificado">
			</div>
			
			<div class="form-group col-sm-6 control-label">
				<label for="">Cargo do Assinante</label>
				<input required ng-model="cert.form.cargoAssinante" value={{cert.form.cargoAssinante}} type="text" class="form-control" id="" placeholder="Nome do membro DFJUG que vai assinar o certificado">
			</div>
			
			<div class="form-group col-sm-6 control-label">
				<label for="" >Descrição da Contribuição</label>
				<textarea required ng-model="cert.form.descricaoContribuicao" class="form-control" rows="3" placeholder="ex: desta iniciativa que visa fomentar a melhoria da qualidade do ensino de programação de jogos Java para crianças o Brasil">{{cert.form.descricaoContribuicao}}</textarea>
			</div>
			
			<div class="form-group col-sm-6 control-label">
				<label for="" >Nome(s) do(s) Vonluntário(s)</label>
				<textarea required ng-model="cert.form.nomeVoluntario" class="form-control" rows="3" placeholder="Coloque cada nome separado por ponto-e-virgula ">{{cert.form.nomeVoluntario}}</textarea>
			</div>
			
			<div class="form-group col-sm-12 control-label">
				<textarea required ng-show="cert.form.editTemplate" ng-model="cert.form.template" class="form-control" rows="3" placeholder="Coloque cada nome separado por ponto-e-virgula ">{{cert.form.template}}</textarea>
			</div >	
			
			<div class="form-group col-sm-12 control-label">
				<button ng-show="certForm.$valid" class="btn btn-primary" type="submit" >Gerar</button>
				
			</div >
			
			<div  class="clearfix"></div>
			
			
			
		</form>
		<div class="form-group col-sm-12 control-label">
				<button ng-click ="cert.showVisualizacao()" class="btn btn-default" >Visualizador</button>
				<button  ng-click ="cert.editTemplateToogle()" class="btn btn-default" >Editar Template</button>
				
				
				
		</div >

		
		
		
	
		
		
		
		
		<div ng-show="cert.form.visualizar" style="font-family: arial;">
			<div  class="clearfix"></div>
			<div class=" well well-sm">
				<h2>Visualizador </h2>
				<small>
					<p>O certificado abaixo é apenas um modelo.</p>
					<p>Para carregar um exemplo clique em  <button ng-show="cert.form.visualizar" ng-click ="cert.carregarExemplo()" class="btn btn-default" >Carregar Exemplo</button></p>
					<p> Para ver o exemplo no pdf clique em 
						<button ng-show="cert.form.visualizar" ng-click ="cert.toPDF()" ng-show="cert.form.visualizar" class="btn btn-default" >Ver PDF</button>
					</p>
					
				</small>
			</div>

			
			
			<div id="toPDF"  bind-html-compile="cert.form.template" alt="Responsive image" style="font-family: arial;  border:blue solid 1px; height:629px; width:886px; background: url('data:image/png;base64,') 0 0;"></div>
		</div>
		
		<div  class="clearfix"></div>
		
		
		<br/>
		
		
	</div>


